CREATE MATERIALIZED VIEW stream_query AS SELECT t_1.o_orderkey AS col_0, t_1.o_orderkey AS col_1 FROM customer AS t_0 RIGHT JOIN orders AS t_1 ON t_0.c_mktsegment = t_1.o_orderstatus WHERE false GROUP BY t_1.o_orderkey;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
